import React from 'react';
import MehndiLogo from 'Images/MehndiLogo';
function Header(){
    return <div>
        <section>
            <image src={MehndiLogo} alt="Logo Image" />
            <p>Hellos</p>
        </section>
    </div>
}

export default Header;
